import React, {Component} from 'react';
import { Form, FormGroup, Label, Input, Button, Col, FormFeedback } from 'reactstrap';
import './Login.css';

class Login extends Component {
    render() {
        return (
            <div className="Login">
                <Form>
                    <FormGroup row>
                        <Label for="loginUsername" sm="2">Username</Label>
                        <Col sm="10">
                            <Input type="username" name="username" id="loginUsername"/>
                        </Col>
                    </FormGroup>
                    <FormGroup row>
                        <Label for="loginPassword" sm={2} >Password</Label>
                        <Col sm={10}>
                            <Input type="password" name="password" id="loginPassword" />
                        </Col>
                    </FormGroup>
                    <Button>Submit</Button>
                </Form>
            </div>
        );
    }
}

export default Login;
